import { Route, Routes } from "react-router";
import { BrowserRouter } from "react-router-dom";
import "./App.css";
import ListeEnchere from "./View/Page/Employe/Page/ListeEnchere";
import HistoriqueEnchere from "./View/Page/Employe/Page/HistoriqueEnchere";

function App() {
  return (
    <div
      id="main-wrapper"
      data-theme="light"
      data-layout="vertical"
      data-navbarbg="skin6"
      data-sidebartype="full"
      data-sidebar-position="fixed"
      data-header-position="fixed"
      data-boxed-layout="full"
    >
      <BrowserRouter>
        <Routes>
          <Route path="/aClient" element={<ListeEnchere />} /></Routes>
          <Route path="/hEnchere" element={<HistoriqueEncherere />}></Route>
      </BrowserRouter>
    </div>
  );
}

export default App;
